import React from "react"
import ReactDOM from "react-dom"


function MyInfo() {
	return (
		<div>
			<h1>MARIA</h1>
			<p>kfjshflsehflasjlfjsdjfklsejfkjsekfjklsdjfkjsdkfsejfklsjklfsdkljfsklj</p>
			<ul><li>Japan</li><li>Nepal</li><li>Australia</li></ul>
		</div>
	)
}


ReactDOM.render(
	<MyInfo />,
	document.getElementById("root")
)
